/*!

=========================================================
* Argon Dashboard PRO React - v1.2.1
=========================================================

* Product Page: https://www.creative-tim.com/product/argon-dashboard-pro-react
* Copyright 2021 Creative Tim (https://www.creative-tim.com)

* Coded by Creative Tim

=========================================================

* The above copyright notice and this permission notice shall be included in all copies or substantial portions of the Software.

*/
import React from "react";

// reactstrap components
import {
  Card,
  CardBody,
  CardHeader,
  Container,
  UncontrolledCarousel,
  Row,
  Col,
  CardImg,
} from "reactstrap";

// core components
import SimpleHeader from "components/Headers/SimpleHeader.js";

import "./style.css";

function Dashboard() {
  return (
    <>
      <SimpleHeader name="Dashboard" parentName="Dashboard" />
      <Container className="mt--6" fluid>
        <Card>
          <CardBody>
            <UncontrolledCarousel
              className="carousel"
              items={[
                {
                  key: 1,
                  src: `${
                    process.env.PUBLIC_URL + "/180503113442_DSC_0014.jpg"
                  }`,
                },
                {
                  key: 2,
                  src: `${
                    process.env.PUBLIC_URL +
                    "/Campus View of Sushila Devi Bansal College of Engineering Indore_Campus-View.jpg"
                  }`,
                },
                {
                  key: 3,
                  src: `${process.env.PUBLIC_URL + "/2021-03-15.jpg"}`,
                },
              ]}
            />
          </CardBody>
        </Card>
      </Container>
      <Container className="mt-0" fluid>
        <Row>
          <Col lg="4">
            <div className="card-wrapper">
              <Card>
                <Col align="center">
                  <h2 className="mt-2">
                    Coding Souls<span>(Until Salvation)</span>
                  </h2>
                  <CardImg
                    alt="..."
                    src={
                      process.env.PUBLIC_URL +
                      "/codinsoulslogo-removebg-preview.png"
                    }
                    top
                    className="p-4"
                    style={{ width: "80%", height: "100%" }}
                  />
                </Col>
                <CardBody className="mt-0"></CardBody>
              </Card>
            </div>
          </Col>
        </Row>
      </Container>
    </>
  );
}

export default Dashboard;
